import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
//nav component
function Navbar(){
  return(
    <nav>
      <h1>Perfumy</h1>
    </nav>
  )
}

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
